import Navbar from "react-bootstrap/Navbar";
import Nav from "react-bootstrap/Nav";
import Container from "react-bootstrap/Container";

import Link from "next/link";

function Navigation() {
  return (
    // <Navbar expand="lg" style={{ backgroundColor: "#512da8" }}>
    // <Navbar expand="lg" style={{ backgroundColor: "#0277bd" }}>
    <Navbar expand="lg" style={{ backgroundColor: "#01579b" }}>
      <Container>
        <Navbar.Brand href="#home">
          <Link href="/">
            <a style={{ marginRight: "60px", color: "white" }}>Westfield Web</a>
          </Link>
        </Navbar.Brand>
        <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <Navbar.Collapse id="basic-navbar-nav">
          <Nav className="mr-auto">
            <Link href="/plansandpricing">
              <a style={{ marginRight: "40px", color: "white" }}>
                Plans and Pricing
              </a>
            </Link>

            <Link href="/portfolio">
              <a style={{ color: "white" }}>Portfolio</a>
            </Link>
          </Nav>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
}

export default Navigation;
